import "./ProfileCard.css";

function ProfileCard() {
  const [selected, setSelected] = useState("");

  const handleChange = (event) => {
    setSelected(event.target.value);
  };

  return (
    <div>
      <div className="profile-card"></div>
    </div>
  );
}

export default ProfileCard;
